public partial class AutoCompletePage : System.Web.UI.Page\n{\n    private List<string> _productNames;\n\n    protected void Page_Load(object sender, EventArgs e)\n    {\n        if (!IsPostBack)\n        {\n            // Load data once on initial page load\n            _productNames = GetAllProductNamesFromDatabase();\n        }\n    }\n\n    [System.Web.Services.WebMethod]\n    public static List<string> GetProducts(string prefixText)\n    {\n        var autoCompletePage = new AutoCompletePage();\n        return autoCompletePage._productNames\n                             .Where(x => x.StartsWith(prefixText, StringComparison.OrdinalIgnoreCase))\n                             .ToList();\n    }\n\n    private List<string> GetAllProductNamesFromDatabase()\n    {\n        // Implement your database query here\n        // Example: SELECT ProductName FROM Products\n        using (var connection = new SqlConnection("YourConnectionString"))\n        {\n            var command = new SqlCommand("SELECT ProductName FROM Products", connection);\n            connection.Open();\n            var reader = command.ExecuteReader();\n            var productNames = new List<string>();\n            while (reader.Read())\n            {\n                productNames.Add(reader["ProductName"].ToString());\n            }\n            return productNames;\n        }\n    }\n}